Travel Documentary hosted by Ken Boynton, published by PBS in 2010 - English narration


Information
------------------------------

Over Alaska

Discover the stunning views and rich history of Alaska. 
Take off on a breathtaking journey in Over Alaska as you soar above the vast landscapes of the 49th state. Go face-to-face with Mount McKinley and fly over the craggy crevasses of electric blue glaciers. Join kayakers as they navigate icy waters. Then, feel the wind sting your cheeks as you speed past icebergs and along the Iditarod, the worlds most famous sled race. Touch down and experience Alaska's abundant wildlife from bears to whales through the lens of an accomplished and often daring photographer. Don't forget to stop and sniff the wildflowers! Over Alaska, previously seen on public television, takes you from Anchorage, a modern city in the middle of six enormous mountain ranges, to the abandoned mining camp Kennecott, and gives you an insider's look at the state's history, heritage, and culture.

